// src/world/aux/AuxiliaryHolder.ts
var EMPTY_CELLTRACK = [];

class AuxiliaryHolder {
  auxiliaries = [];
  cellTracks = EMPTY_CELLTRACK;
  active = false;
  activate() {
    if (this.active) {
      return;
    }
    this.active = true;
    this.auxiliaries.forEach((aux) => aux.activate?.());
  }
  deactivate() {
    if (!this.active) {
      return;
    }
    this.active = false;
    this.auxiliaries.forEach((aux) => aux.deactivate?.());
  }
  trackCell(cell) {
    let didTrack = false;
    for (const v of this.cellTracks) {
      if (v.trackCell(cell)) {
        didTrack = true;
      }
    }
    return didTrack;
  }
  untrackCell(cellTag) {
    for (const v of this.cellTracks) {
      v.untrackCell(cellTag);
    }
  }
  addAuxiliary(...aux) {
    aux.forEach((a) => {
      a.holder = this;
      this.auxiliaries.push(a);
      if (this.active) {
        a.activate?.();
      }
    });
    this.onAuxiliariesChange();
    return this;
  }
  removeAuxiliary(...aux) {
    const removeSet = new Set(aux);
    let j = 0;
    for (let i = 0;i < this.auxiliaries.length; i++) {
      const a = this.auxiliaries[i];
      if (!removeSet.has(a)) {
        this.auxiliaries[j] = a;
        j++;
      } else {
        a.deactivate?.();
        a.holder = undefined;
      }
    }
    this.auxiliaries.length = j;
    this.onAuxiliariesChange();
  }
  onAuxiliariesChange() {
    this.cellTracks = this.auxiliaries?.filter((a) => !!a.trackCell || !!a.untrackCell) ?? EMPTY_CELLTRACK;
  }
}

// src/core/value/Progressive.ts
class Progressive {
  getValue;
  apply;
  _goal;
  active = false;
  speed = 0;
  locker;
  _element;
  constructor(element, getValue, apply) {
    this.getValue = getValue;
    this.apply = apply;
    this._element = element;
    this._goal = this.getValue(element);
  }
  set element(element) {
    this._element = element;
    this._goal = this.getValue(element);
    this.locker = undefined;
  }
  setGoal(value, speed, locker) {
    if (this.locker && this.locker !== locker) {
      return;
    }
    if (this._goal !== value || this.speed !== speed) {
      this.speed = speed;
      this._goal = value;
      this.locker = locker;
      this.active = true;
    }
  }
  get goal() {
    return this._goal;
  }
  update(deltaTime) {
    if (this.active) {
      const curValue = this.getValue(this._element);
      const diff = this.goal - curValue;
      const dDist = Math.min(Math.abs(diff), this.speed * deltaTime);
      if (dDist <= 0.01) {
        this.apply(this._element, this.goal);
        this.active = false;
        this.locker = undefined;
      } else {
        this.apply(this._element, curValue + dDist * Math.sign(diff));
      }
    }
    return this.active;
  }
}

// src/core/value/ProgressivePool.ts
class ProgressivePool extends ObjectPool {
  constructor() {
    super((progressive, val) => {
      if (!progressive) {
        return new Progressive(val, (elem) => elem.valueOf(), (elem, value) => elem.setValue(value));
      }
      progressive.element = val;
      return progressive;
    });
  }
}

// src/core/value/NumVal.ts
var progressivePool = new ProgressivePool;

class NumVal {
  onChange;
  _value = 0;
  progressive;
  constructor(value = 0, onChange) {
    this.onChange = onChange;
    this._value = value;
  }
  valueOf() {
    return this._value;
  }
  setValue(value) {
    if (value !== this._value) {
      this._value = value;
      this.onChange?.(this._value);
    }
    return this;
  }
  addValue(value) {
    this.setValue(this._value + value);
    return this;
  }
  update(deltaTime) {
    if (this.progressive) {
      const didUpdate = !!this.progressive?.update(deltaTime);
      if (!didUpdate) {
        progressivePool.recycle(this.progressive);
        this.progressive = undefined;
      }
      return didUpdate;
    }
    return false;
  }
  refresh({ deltaTime, data, motor, refresher }) {
    if (!data.update(deltaTime)) {
      motor.stopUpdate(refresher);
    }
  }
  progressTowards(goal, speed, locker, motor) {
    if (!this.progressive) {
      this.progressive = progressivePool.create(this);
    }
    this.progressive.setGoal(goal, speed, locker);
    if (motor) {
      motor.loop(this, this);
    }
  }
  get goal() {
    return this.progressive?.goal ?? this.valueOf();
  }
}

// src/gl/transform/ProjectionMatrix.ts
var DEFAULT_PERSPECTIVE_LEVEL = 1;
var DEFAULT_ZOOM = 1;

class ProjectionMatrix extends AuxiliaryHolder {
  onChange;
  baseMatrix = Matrix_default.create();
  perspectiveMatrix = Matrix_default.create();
  orthoMatrix = Matrix_default.create();
  perspective;
  zoom;
  _size = [0, 0];
  constructor(onChange) {
    super();
    this.onChange = onChange;
    this.perspective = new NumVal(DEFAULT_PERSPECTIVE_LEVEL, onChange);
    this.zoom = new NumVal(DEFAULT_ZOOM, (zoom) => {
      this.configure(this._size, zoom);
    });
  }
  configPerspectiveMatrix(angle2, ratio, near, far) {
    this.perspectiveMatrix.perspective(angle2, ratio, near, far);
  }
  configOrthoMatrix(width, height2, near, far) {
    this.orthoMatrix.ortho(-width / 2, width / 2, -height2 / 2, height2 / 2, near, far);
  }
  configure(size, zoom, near = 0.5, far = 1e4) {
    if (!zoom) {
      zoom = this.zoom.valueOf();
    }
    this._size[0] = size[0];
    this._size[1] = size[1];
    const ratio = this._size[0] / this._size[1];
    const angle2 = 45 / Math.sqrt(zoom);
    this.configPerspectiveMatrix(angle2, ratio, Math.max(near, 0.00001), far);
    this.configOrthoMatrix(ratio / zoom / zoom, 1 / zoom / zoom, -far, far);
    this.onChange?.();
  }
  getMatrix() {
    this.baseMatrix.combine(this.orthoMatrix, this.perspectiveMatrix, this.perspective.valueOf());
    return this.baseMatrix.getMatrix();
  }
}

