function toVector(x, y, z) {
  _position[0] = x;
  _position[1] = y;
  _position[2] = z;
  return _position;
}
function transformToPosition(transform, pos = _position) {
  const m = transform.getMatrix();
  pos[0] = m[12];
  pos[1] = m[13];
  pos[2] = m[14];
  return pos;
}
var _position = [0, 0, 0];
var _matrix = Matrix_default.create();

// src/gl/transform/PositionMatrix.ts
class PositionMatrix extends AuxiliaryHolder {
  matrix = Matrix_default.create().setPosition(0, 0, 0);
  _position = [0, 0, 0];
  changeListeners = new Set;
  moveBlocker;
  constructor(onChange) {
    super();
    if (onChange) {
      this.onChange(onChange);
    }
  }
  onChange(listener) {
    this.changeListeners.add(listener);
    return this;
  }
  removeChangeListener(listener) {
    this.changeListeners.delete(listener);
  }
  changedPosition(dx, dy2, dz) {
    transformToPosition(this.matrix, this._position);
    for (let listener of this.changeListeners) {
      listener(dx, dy2, dz);
    }
  }
  moveBy(x, y, z, turnMatrix) {
    const vector = Matrix_default.getMoveVector(x, y, z, turnMatrix);
    const blocked = this.moveBlocker?.isBlocked(toVector(this.position[0] + vector[0], this.position[1] + vector[1], this.position[2] + vector[2]), this.position);
    if (!blocked) {
      if (vector[0] || vector[1] || vector[2]) {
        this.matrix.move(vector);
        this.changedPosition(x, y, z);
      }
    }
    return !blocked;
  }
  moveTo(x, y, z) {
    const blocked = this.moveBlocker?.isBlocked(toVector(x, y, z), this.position);
    if (!blocked) {
      const [curX, curY, curZ] = this.matrix.getPosition();
      if (curX !== x || curY !== y || curZ !== z) {
        const dx = x - curX, dy2 = y - curY, dz = z - curZ;
        this.matrix.setPosition(x, y, z);
        this.changedPosition(dx, dy2, dz);
      }
    }
    return !blocked;
  }
  get position() {
    return this._position;
  }
  gotoPos(x, y, z, speed = 0.1) {
    const curPos = this.position;
    const dx = x - curPos[0];
    const dy2 = y - curPos[1];
    const dz = z - curPos[2];
    const dist2 = Math.sqrt(dx * dx + dy2 * dy2 + dz * dz);
    if (dist2 > 0.01) {
      const sp = Math.min(dist2, speed);
      return this.moveBy(dx / dist2 * sp, dy2 / dist2 * sp, dz / dist2 * sp);
    } else {
      return this.moveTo(x, y, z);
    }
  }
  getMatrix() {
    return this.matrix.getMatrix();
  }
}

// src/updates/UpdateRegistry.ts
class UpdateRegistry {
  applyUpdate;
  motor;
  updatedIds = new Set;
  constructor(applyUpdate, motor) {
    this.applyUpdate = applyUpdate;
    this.motor = motor;
  }
  informUpdate(id) {
    if (!this.updatedIds.has(id)) {
      this.updatedIds.add(id);
    }
    this.motor.scheduleUpdate(this);
  }
  refresh(update) {
    this.applyUpdate(this.updatedIds, update);
    if (this.updatedIds.size) {
      update.motor.scheduleUpdate(this);
    }
  }
}

// src/camera/Camera.ts
class Camera extends AuxiliaryHolder {
  position = new PositionMatrix(() => {
    this.camMatrix.invert(this.position);
    this.updateInformer.informUpdate(MatrixUniform.CAM_POS);
  });
  projection = new ProjectionMatrix(() => this.updateInformer.informUpdate(MatrixUniform.PROJECTION));
  tilt = new TiltMatrix(() => this.updateInformer.informUpdate(MatrixUniform.CAM_TILT));
  turn = new TurnMatrix(() => this.updateInformer.informUpdate(MatrixUniform.CAM_TURN));
  curvature = new NumVal(0.05, () => this.updateInformerFloat.informUpdate(FloatUniform.CURVATURE));
  distance = new NumVal(0.5, () => this.updateInformerFloat.informUpdate(FloatUniform.CAM_DISTANCE));
  blur = new NumVal(1, () => this.updateInformerFloat.informUpdate(FloatUniform.BG_BLUR));
  fade = new NumVal(0, () => this.updateInformerFloat.informUpdate(FloatUniform.FADE));
  camMatrix = Matrix_default.create();
  _bgColor = [0, 0, 0];
  _viewportSize = [0, 0];
  updateInformer;
  updateInformerFloat;
  updateInformerVector;
  engine;
  constructor({ engine, motor }) {
    super();
    this.engine = engine;
    const cameraMatrices = {
      [MatrixUniform.PROJECTION]: this.projection,
      [MatrixUniform.CAM_POS]: this.camMatrix,
      [MatrixUniform.CAM_TURN]: this.turn,
      [MatrixUniform.CAM_TILT]: this.tilt
    };
    this.updateInformer = new UpdateRegistry((ids) => {
      ids.forEach((type) => this.engine.updateUniformMatrix(type, cameraMatrices[type]));
      ids.clear();
    }, motor);
    const cameraVectors = {
      [VectorUniform.BG_COLOR]: this._bgColor
    };
    this.updateInformerVector = new UpdateRegistry((ids) => {
      ids.forEach((type) => this.engine.updateUniformVector(type, cameraVectors[type]));
      ids.clear();
    }, motor);
    const cameraVal = {
      [FloatUniform.BG_BLUR]: this.blur,
      [FloatUniform.CAM_DISTANCE]: this.distance,
      [FloatUniform.CURVATURE]: this.curvature,
      [FloatUniform.TIME]: undefined,
      [FloatUniform.FADE]: this.fade
    };
    this.updateInformerFloat = new UpdateRegistry((ids, updatePayload) => {
      ids.forEach((type) => {
        const val = cameraVal[type];
        if (val) {
          this.engine.updateUniformFloat(type, val.valueOf(updatePayload.time));
        }
      });
      ids.clear();
    }, motor);
    this.addAuxiliary(this.position);
  }
  activate() {
    super.activate();
    this.updateInformer.informUpdate(MatrixUniform.PROJECTION);
    this.updateInformer.informUpdate(MatrixUniform.CAM_POS);
    this.updateInformer.informUpdate(MatrixUniform.CAM_TURN);
    this.updateInformer.informUpdate(MatrixUniform.CAM_TILT);
    this.updateInformerFloat.informUpdate(FloatUniform.CURVATURE);
    this.updateInformerFloat.informUpdate(FloatUniform.CAM_DISTANCE);
    this.updateInformerFloat.informUpdate(FloatUniform.BG_BLUR);
    this.updateInformerVector.informUpdate(VectorUniform.BG_COLOR);
  }
  resizeViewport(width, height2) {
    if (this._viewportSize[0] !== width || this._viewportSize[1] !== height2) {
      this._viewportSize[0] = width;
      this._viewportSize[1] = height2;
      this.projection.configure(this._viewportSize);
    }
  }
  set bgColor(rgb) {
    const red = rgb >> 16 & 255;
    const green = rgb >> 8 & 255;
    const blue = rgb & 255;
    this._bgColor[0] = red / 255;
    this._bgColor[1] = green / 255;
    this._bgColor[2] = blue / 255;
    this.updateInformerVector.informUpdate(VectorUniform.BG_COLOR);
    this.engine.setBgColor(this._bgColor);
  }
}

// src/gl/transform/aux/CellChangeAuxiliary.ts
class CellChangeAuxiliary extends AuxiliaryHolder {
  cellUtils;
  visitableCell;
  positionMatrix;
  cellSize;
  previousCellPos;
  listener = () => this.checkPosition();
  constructor(cellUtils, config) {
    super();
    this.cellUtils = cellUtils;
    this.cellSize = config?.cellSize ?? 1;
    this.previousCellPos = [Number.NaN, Number.NaN, Number.NaN, this.cellSize];
  }
  set holder(value) {
    this.positionMatrix = value;
  }
  checkPosition() {
    if (!this.positionMatrix || !this.visitableCell) {
      return;
    }
    const pos = this.positionMatrix.position;
    const cell = this.cellUtils.cellFromPos(pos, this.previousCellPos[3]);
    if (this.previousCellPos[0] !== cell.pos[0] || this.previousCellPos[1] !== cell.pos[1] || this.previousCellPos[2] !== cell.pos[2]) {
      this.previousCellPos[0] = cell.pos[0];
      this.previousCellPos[1] = cell.pos[1];
      this.previousCellPos[2] = cell.pos[2];
      this.visitableCell.visitCell(cell);
    }
  }
  activate() {
    super.activate();
    this.positionMatrix?.onChange(this.listener);
    this.previousCellPos[0] = Number.NaN;
    this.previousCellPos[1] = Number.NaN;
    this.previousCellPos[2] = Number.NaN;
    this.checkPosition();
  }
  deactivate() {
    this.positionMatrix?.removeChangeListener(this.listener);
    super.deactivate();
  }
}

// src/world/aux/Auxiliaries.ts
class Auxiliaries {
  auxiliaries;
  active = false;
  constructor(auxiliaries) {
    this.auxiliaries = auxiliaries;
  }
  static from(...aux) {
    return new Auxiliaries(aux);
  }
  get length() {
    return this.auxiliaries.length;
  }
  at(index) {
    if (!this.active) {
      return;
    }
    return this.auxiliaries.at(index);
  }
  trackCell(cell) {
    if (!this.active) {
      return false;
    }
    let didTrack = false;
    forEach3(this.auxiliaries, (aux) => {
      if (aux?.trackCell?.(cell)) {
        didTrack = true;
      }
    });
    return didTrack;
  }
  untrackCell(cellTag) {
    if (!this.active) {
      return;
    }
    forEach3(this.auxiliaries, (aux) => aux?.untrackCell?.(cellTag));
  }
  activate() {
    if (this.active) {
      return;
    }
    this.active = true;
    forEach3(this.auxiliaries, (aux) => aux?.activate?.());
  }
  deactivate() {
    if (!this.active) {
      return;
    }
    this.active = false;
    forEach3(this.auxiliaries, (aux) => aux?.deactivate?.());
  }
}

