// src/world/aux/ToggleAuxiliary.ts
class ToggleAuxiliary {
  keyboard;
  active = false;
  toggleIndex;
  keys;
  auxiliaries;
  keyListener;
  constructor(config) {
    this.keys = map(config.auxiliariesMapping, (keyMap) => keyMap?.key);
    this.keyListener = {
      onKeyDown: (keyCode) => {
        if (this.keys.indexOf(keyCode) >= 0) {
          const wasActive = this.active;
          this.auxiliary?.deactivate?.();
          this.toggle(keyCode);
          if (wasActive) {
            this.auxiliary?.activate?.();
          }
        }
      }
    };
    this.auxiliaries = map(config.auxiliariesMapping, (keyMap) => keyMap?.aux);
    this.toggleIndex = config.initialIndex ?? 0;
  }
  set holder(keyboard) {
    this.keyboard = keyboard;
  }
  get auxiliary() {
    return this.auxiliaries.at(this.toggleIndex);
  }
  toggle(key) {
    if (this.keys[this.toggleIndex] !== key) {
      this.toggleIndex = this.keys.indexOf(key);
    } else {
      const nextIndex = this.keys.length ? (this.toggleIndex + 1) % this.keys.length : 0;
      if (this.keys[nextIndex] === key) {
        this.toggleIndex = nextIndex;
      }
    }
  }
  activate() {
    if (!this.active) {
      this.active = true;
      this.keyboard?.addListener(this.keyListener);
      this.auxiliary?.activate?.();
    }
  }
  deactivate() {
    if (this.active) {
      this.active = false;
      this.keyboard?.removeListener(this.keyListener);
      this.auxiliary?.deactivate?.();
    }
  }
}

// src/world/pools/CellPool.ts
class CellPool extends ObjectPool {
  constructor(onCreate) {
    super((cell, cx, cy, cz, cellSize) => {
      const tag = cellTag(cx, cy, cz, cellSize);
      if (!cell) {
        return { pos: [cx, cy, cz, cellSize], tag };
      }
      cell.pos[0] = cx;
      cell.pos[1] = cy;
      cell.pos[2] = cz;
      cell.pos[3] = cellSize;
      cell.tag = tag;
      return cell;
    }, onCreate);
  }
  createFromPos(pos, cellSize) {
    const [x, y, z] = pos;
    const cx = Math.round(x / cellSize);
    const cy = Math.round(y / cellSize);
    const cz = Math.round(z / cellSize);
    return this.create(cx, cy, cz, cellSize);
  }
}

// src/world/pools/VectorPool.ts
class VectorPool extends ObjectPool {
  constructor(onCreate) {
    super((vector, x, y, z) => {
      if (!vector) {
        return [x, y, z];
      }
      vector[0] = x;
      vector[1] = y;
      vector[2] = z;
      return vector;
    }, onCreate);
  }
}

