// src/utils/DoubleLinkList.ts
class NodePool extends ObjectPool {
  constructor() {
    super((elem, value) => {
      if (!elem) {
        return { value };
      }
      elem.value = value;
      elem.prev = undefined;
      elem.next = undefined;
      return elem;
    });
  }
}

class DoubleLinkList {
  start;
  end;
  nodeMap = new Map;
  pool = new NodePool;
  constructor(edgeValue) {
    this.start = { value: edgeValue };
    this.end = { value: edgeValue };
    this.start.next = this.end;
    this.end.prev = this.start;
  }
  clear() {
    while (this.removeEntry(this.start.next)) {
    }
  }
  get size() {
    return this.nodeMap.size;
  }
  tags = [];
  getList() {
    this.tags.length = 0;
    for (let e = this.start.next;e !== this.end; e = e.next) {
      this.tags.push(e.value);
    }
    return this.tags;
  }
  pushTop(value) {
    const newTop = this.pool.create(value);
    this.nodeMap.set(value, newTop);
    this.moveTop(value);
  }
  contains(value) {
    return this.nodeMap.has(value);
  }
  moveTop(value) {
    const entry = this.nodeMap.get(value);
    if (entry) {
      if (entry.prev && entry.next) {
        entry.prev.next = entry.next;
        entry.next.prev = entry.prev;
      }
      const formerTop = this.end.prev;
      const newTop = entry;
      newTop.prev = formerTop;
      newTop.next = this.end;
      formerTop.next = this.end.prev = newTop;
      return true;
    }
    return false;
  }
  remove(value) {
    const entry = this.nodeMap.get(value);
    if (entry) {
      this.removeEntry(entry);
      return true;
    } else {
      return false;
    }
  }
  removeEntry(entry) {
    if (entry === this.end || entry === this.start) {
      return false;
    }
    entry.prev.next = entry.next;
    entry.next.prev = entry.prev;
    entry.prev = entry.next = undefined;
    this.pool.recycle(entry);
    this.nodeMap.delete(entry.value);
    return true;
  }
  popBottom() {
    const entryToRemove = this.start.next;
    if (entryToRemove !== this.end) {
      this.removeEntry(entryToRemove);
      return entryToRemove.value;
    }
    return;
  }
}

// src/world/grid/SurroundingTracker.ts
class SurroundingTracker {
  cellTags = new DoubleLinkList("");
  cellTrack;
  cellUtils;
  range;
  base;
  cellLimit;
  cellSize;
  tempCell;
  constructor({ cellTrack, cellUtils }, { range, cellLimit, cellSize = 1 } = {}) {
    this.range = [range?.[0] ?? 3, range?.[1] ?? 3, range?.[2] ?? 3];
    this.base = this.range.map((r) => Math.ceil(-r / 2));
    this.cellLimit = Math.max(0, cellLimit ?? 10);
    this.cellSize = cellSize ?? 1;
    this.cellTrack = cellTrack;
    this.cellUtils = cellUtils;
    this.tempCell = {
      pos: [0, 0, 0, this.cellSize],
      tag: ""
    };
  }
  set holder(aux) {
    aux.visitableCell = this;
  }
  getCellTags() {
    return this.cellTags.getList();
  }
  iterateCells(visitedCell, callback) {
    const { range, base, tempCell } = this;
    const { pos } = visitedCell;
    const cellX = pos[0] + base[0];
    const cellY = pos[1] + base[1];
    const cellZ = pos[2] + base[2];
    const tempCellPos = tempCell.pos;
    for (let z = 0;z < range[0]; z++) {
      for (let x = 0;x < range[2]; x++) {
        for (let y = 0;y < range[1]; y++) {
          tempCellPos[0] = cellX + x;
          tempCellPos[1] = cellY + y;
          tempCellPos[2] = cellZ + z;
          tempCell.tag = cellTag(tempCellPos[0], tempCellPos[1], tempCellPos[2], tempCellPos[3]);
          callback(this.cellUtils.cellAt(cellX + x, cellY + y, cellZ + z, this.cellSize));
        }
      }
    }
  }
  onCellVisit = (cell) => {
    if (!this.cellTags.contains(cell.tag)) {
      if (this.cellTrack.trackCell?.(cell)) {
        this.cellTags.pushTop(cell.tag);
      }
    } else {
      this.cellTags.moveTop(cell.tag);
    }
  };
  visitCell(visitedCell) {
    this.iterateCells(visitedCell, this.onCellVisit);
    this.trimCells();
  }
  trimCells() {
    while (this.cellTags.size > this.cellLimit) {
      const removedTag = this.cellTags.popBottom();
      if (removedTag) {
        this.cellTrack.untrackCell?.(removedTag);
      }
    }
  }
  deactivate() {
    this.cellTags.clear();
  }
}

